import React, { useState, useRef } from "react";

function App() {
  const [selectedFile, setSelectedFile] = useState(null);
  const [caption, setCaption] = useState("");
  const [imagePreview, setImagePreview] = useState(null);
  const [cameraActive, setCameraActive] = useState(false);
  const videoRef = useRef(null);
  const canvasRef = useRef(null);
  const streamRef = useRef(null);

  // Handle File Selection (Mobile + Laptop)
  const handleFileChange = (event) => {
    const file = event.target.files[0];
    if (file) {
      setSelectedFile(file);
      setImagePreview(URL.createObjectURL(file));
    }
  };

  // Handle Upload to Backend
  const handleUpload = async () => {
    if (!selectedFile) {
      console.error("No file selected");
      alert("Please select or capture an image first.");
      return;
    }

    const formData = new FormData();
    formData.append("file", selectedFile);

    console.log("Sending request to backend...");

    try {
      const response = await fetch("http://10.251.182.177:8000/caption/", {
        method: "POST",
        body: formData,
      });

      if (!response.ok) {
        throw new Error(`Server responded with status: ${response.status}`);
      }

      const data = await response.json();
      console.log("Caption received:", data.caption);
      setCaption(data.caption);
    } catch (error) {
      console.error("Error fetching caption:", error);
      alert("Error generating caption. Please try again.");
    }
  };

  // Start Camera (Laptop Webcam)
  const startCamera = async () => {
    try {
      const stream = await navigator.mediaDevices.getUserMedia({ video: true });
      streamRef.current = stream;
      setCameraActive(true);

      setTimeout(() => {
        if (videoRef.current) {
          videoRef.current.srcObject = stream;
          videoRef.current.play();
        } else {
          console.error("Video element not found.");
        }
      }, 500);
    } catch (error) {
      console.error("Error accessing camera:", error);
      alert("Could not access camera. Please check your permissions.");
    }
  };

  // Stop Camera
  const stopCamera = () => {
    if (streamRef.current) {
      streamRef.current.getTracks().forEach((track) => track.stop());
    }
    setCameraActive(false);
  };

  // Capture Image from Webcam
  const captureImage = () => {
    if (!videoRef.current || !canvasRef.current) {
      console.error("Camera is not active.");
      return;
    }

    const canvas = canvasRef.current;
    const context = canvas.getContext("2d");
    context.drawImage(videoRef.current, 0, 0, canvas.width, canvas.height);

    canvas.toBlob((blob) => {
      const file = new File([blob], "captured_image.jpg", { type: "image/jpeg" });
      setSelectedFile(file);
      setImagePreview(URL.createObjectURL(blob));
    }, "image/jpeg");
  };

  return (
    <div style={{ textAlign: "center", padding: "20px" }}>
      <h2>VisionMate - Image Captioning</h2>

      {/* Mobile: File Upload & Open Camera */}
      <input type="file" accept="image/*" capture="environment" onChange={handleFileChange} />
      <button onClick={handleUpload} style={{ marginLeft: "10px" }}>Generate Caption</button>

      {/* Laptop: Webcam Access */}
      <div style={{ marginTop: "20px" }}>
        {!cameraActive ? (
          <button onClick={startCamera}>Open Camera (Laptop)</button>
        ) : (
          <>
            <video ref={videoRef} autoPlay width="400" height="300"></video>
            <canvas ref={canvasRef} width="400" height="300" style={{ display: "none" }}></canvas>
            <button onClick={captureImage} style={{ marginLeft: "10px" }}>Capture Image</button>
            <button onClick={stopCamera} style={{ marginLeft: "10px" }}>Close Camera</button>
          </>
        )}
      </div>

      {/* Display Image Preview */}
      {imagePreview && (
        <div style={{ marginTop: "20px" }}>
          <h4>Preview:</h4>
          <img src={imagePreview} alt="Selected or Captured" width="300" />
        </div>
      )}

      {/* Caption Display */}
      {caption && (
        <p style={{ marginTop: "20px", fontSize: "18px", fontWeight: "bold" }}>
          <strong>Caption:</strong> {caption}
        </p>
      )}
    </div>
  );
}

export default App;
